    <script src="https://code.jquery.com/jquery-3.4.1.min.js" integrity="sha256-CSXorXvZcTkaix6Yvo6HppcZGetbYMGWSFlBw8HfCJo=" crossorigin="anonymous"></script>
    <script>
    $(document).ready(function(){
            $("#hold-list").empty();
            $("#open-lift").empty();
            $("#closed-lift").empty();
            jQuery.get('/jay-status', function(data, status){
                if(status === "success"){
                    const {holdLift, openLift, closedLift} = data;
                    for(let i = 0; i < holdLift.length; i++){
                        if (holdLift[i] === 'Jet Triple') {
                            document.getElementById('jet').style.fill = 'orange'
                            document.getElementById('jet').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Aerial Tram') {
                            document.getElementById('tram').style.fill = 'orange'
                            document.getElementById('tram').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Taxi Quad') {
                            document.getElementById('taxi').style.fill = 'orange'
                            document.getElementById('taxi').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Metro Quad') {
                            document.getElementById('metro').style.fill = 'orange'
                            document.getElementById('metro').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Village Double') {
                            document.getElementById('double').style.fill = 'orange'
                            document.getElementById('double').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Flyer Quad') {
                            document.getElementById('flyer').style.fill = 'orange'
                            document.getElementById('flyer').style.stroke = 'orange'
                        } else if (holdLift[i] === 'Bonaventure Quad') {
                            document.getElementById('bonnie').style.fill = 'orange'
                            document.getElementById('bonnie').style.stroke = 'orange'
                        }
                    }
                    for(let i = 0; i < openLift.length; i++){
                        if (openLift[i] === 'Jet Triple') {
                            document.getElementById('jet').style.fill = 'green'
                            document.getElementById('jet').style.stroke = 'green'
                        } else if (openLift[i] === 'Aerial Tram') {
                            document.getElementById('tram').style.fill = 'green'
                            document.getElementById('tram').style.stroke = 'green'
                        } else if (openLift[i] === 'Taxi Quad') {
                            document.getElementById('taxi').style.fill = 'green'
                            document.getElementById('taxi').style.stroke = 'green'
                        } else if (openLift[i] === 'Metro Quad') {
                            document.getElementById('metro').style.fill = 'green'
                            document.getElementById('metro').style.stroke = 'green'
                        } else if (openLift[i] === 'Village Double') {
                            document.getElementById('double').style.fill = 'green'
                            document.getElementById('double').style.stroke = 'green'
                        } else if (openLift[i] === 'Flyer Quad') {
                            document.getElementById('flyer').style.fill = 'green'
                            document.getElementById('flyer').style.stroke = 'green'
                        } else if (openLift[i] === 'Bonaventure Quad') {
                            document.getElementById('bonnie').style.fill = 'green'
                            document.getElementById('bonnie').style.stroke = 'green'
                        }                    }
                    for(let i = 0; i < closedLift.length; i++){
                        if (closedLift[i] === 'Jet Triple') {
                            document.getElementById('jet').style.fill = 'red'
                            document.getElementById('jet').style.stroke = 'red'
                        } else if (closedLift[i] === 'Aerial Tram') {
                            document.getElementById('tram').style.fill = 'red'
                            document.getElementById('tram').style.stroke = 'red'
                        } else if (closedLift[i] === 'Taxi Quad') {
                            document.getElementById('taxi').style.fill = 'red'
                            document.getElementById('taxi').style.stroke = 'red'
                        } else if (closedLift[i] === 'Metro Quad') {
                            document.getElementById('metro').style.fill = 'red'
                            document.getElementById('metro').style.stroke = 'red'
                        } else if (closedLift[i] === 'Village Double') {
                            document.getElementById('double').style.fill = 'red'
                            document.getElementById('double').style.stroke = 'red'
                        } else if (closedLift[i] === 'Flyer Quad') {
                            document.getElementById('flyer').style.fill = 'red'
                            document.getElementById('flyer').style.stroke = 'red'
                        } else if (closedLift[i] === 'Bonaventure Quad') {
                            document.getElementById('bonnie').style.fill = 'red'
                            document.getElementById('bonnie').style.stroke = 'red'
                        }
                    }
                }
            })

    })</script>
